import React, { Component } from 'react';

class WizardCard extends Component {

  render() {
    return (
      <div>
      <h6>{"Wizard Name?"}</h6>
        <p>
          {"Wizard House"} | {"Wizard Redux"}
        </p>
      </div>
    );
  }
}



export default WizardCard;
